import React from "react";
import "@trendmicro/react-sidenav/dist/react-sidenav.css";
import {
  BarChartLine,
  HouseFill,
  Folder,
  WindowDesktop,
} from "react-bootstrap-icons";
import SideNav, {
  Toggle,
  Nav,
  NavItem,
  NavIcon,
  NavText,
} from "@trendmicro/react-sidenav";
import { Colors } from "chart.js";

class SideNavBar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isVisible: true,
    };
  }

  render() {
    return (
      <SideNav
        style={{ backgroundColor: "#113E97", Colors: "#113E97" }}
        onSelect={(selected) => {
          // Add your code here
        }}
      >
        <SideNav.Toggle />
        <SideNav.Nav defaultSelected="banking">
          <NavItem eventKey="home">
            <NavIcon>
              <i className="fa fa-fw fa-home" style={{ fontSize: "1.75em" }} />
              <HouseFill />
            </NavIcon>
            <NavText>Home</NavText>
          </NavItem>
          <NavItem eventKey="account">
            <NavIcon>
              <i
                className="fa fa-fw fa-line-account"
                style={{ fontSize: "1.75em" }}
              />
              <Folder />
            </NavIcon>
            <NavText>Account</NavText>
            <NavItem eventKey="account/accountlist">
              <NavText>Account List</NavText>
            </NavItem>
            <NavItem eventKey="account/recordjournalentry">
              <NavText>Record Journal Entry</NavText>
            </NavItem>
            <NavItem eventKey="account/transactionjournal">
              <NavText>Transaction Journal</NavText>
            </NavItem>
          </NavItem>
          <NavItem eventKey="banking">
            <NavIcon>
              <i
                className="fa fa-fw fa-line-banking"
                style={{ fontSize: "1.75em" }}
              />
              <WindowDesktop />
            </NavIcon>
            <NavText>Banking</NavText>
            <NavItem eventKey="account/accountlist">
              <NavText>Account List</NavText>
            </NavItem>
            <NavItem eventKey="account/recordjournalentry">
              <NavText>Record Journal Entry</NavText>
            </NavItem>
            <NavItem eventKey="account/transactionjournal">
              <NavText>Transaction Journal</NavText>
            </NavItem>
          </NavItem>
        </SideNav.Nav>
      </SideNav>
    );
  }
}

export default SideNavBar;
